import { useCallback } from "react";
import { useNavigate } from "react-router-dom";

import "./SignUp.css";
import { useState } from "react";


const SignUp = () => {

  const [form,setform]=useState({});

  const navigate = useNavigate();

  const onFrameButtonClick = useCallback(() => {
    navigate("/");
  }, [navigate]);

  const onMicrosoftTeamsImage12Click = useCallback(() => {
    // Please sync "landing page" to the project
  }, []);

  const onMicrosoftTeamsImage121Click = useCallback(() => {
    navigate("/");
  }, [navigate]);

  const onContinueClick = useCallback(() => {
    navigate("/login");
  }, [navigate]);


  const validateEmail = (email) =>
   { return email.match(/^(([^<>()[\]\\.,;:\s@\"]+(\.[^<>()[\]\\.,;:\s@\"]+)*)|(\".+\"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/ 
   );
   };
  const validate = () =>
   { const $result = $('#result');
    const email = $('#email').val();
     $result.text('');

  if(validateEmail(email)){
     $result.text(email + ' is valid.');
      $result.css('color', 'green'); 
    } else{
       $result.text(email + ' is invalid.');
        $result.css('color', 'red'); } 
        return false; }



const handelForm=(e)=>{
  setform({
    ...form,
    [e.target.name] : [e.target.value]
  })
}

 const handelSubmit=(e)=>{
   e.preventDefault();
   const response = fetch('http://localhost:5000/signin/demo',{
     method:'GET'
   })
   console.log(response);
   console.log("hello");

 }



  return (




      <div>




      <div className="signup">
        <b className="sign-up1">Sign Up</b>
      </div>
      <button

        className="microsoftteams-image-1-2-wrapper"
        onClick={onFrameButtonClick}
      >
        <img
          className="microsoftteams-image-1-28"
          alt=""
          src="/microsoftteamsimage-1-21@2x.png"
          onClick={onMicrosoftTeamsImage12Click}
        />
      </button>
      {/* <p>{JSON.stringify(form)}</p> */}
      <form onSubmit={handelSubmit}>
      <input className="name" type="text" placeholder="Name" name="name" onChange={handelForm}  />
      <input className="email" type="text" placeholder="Email" name="email"  onChange={handelForm}/>
      <input className="phone-no" type="text" placeholder="Phone No" name="phone-no" onChange={handelForm} />
      <input className="password" type="text" placeholder="Password" name="password" onChange={handelForm} />
      <input className="confirm-password" type="text" name="confirmpassword" placeholder="Confirm Password" onChange={handelForm}/>
      <input className="dob1" type="date"  name="dob" placeholder="DOB" onChange={handelForm}/>
      </form>
      <div className="fixed-rectangle">


        <button
        type="button"
          className="microsoftteams-image-1-29"
          onClick={onMicrosoftTeamsImage121Click}

        />


        <div className="contact-us-parent5">
          <div className="contact-us8">Contact US</div>
          <div className="email-claimlygmailcom8">Email: claimly@gmail.com</div>
          <div className="ph-no-918">Ph No: +91 876543210</div>

        </div>
        </div>

      <img className="group-child18" alt="" src="/frame-3425.svg" />


      <button className="continue" type="submit" onClick={onContinueClick }  onSubmit={handelSubmit}>
        Submit
      </button>



      </div>


  );

};

export default SignUp;
